  private static int zzUnpackTrans(ushort[] packed, int offset, int [] result) {
    var i = 0;       /* index in packed string  */
    var j = offset;  /* index in unpacked array */
    var l = packed.Length;
    while (i + 1 < l) {
      int count = packed[i++];
      int value = packed[i++];
      value--;
      do result[j++] = value; while (--count > 0);
    }
    return j;
  }


